      "About the Author",
      "ERIN MORGENSTERN",
      "is a writer and multimedia artist who describes all her work as being \u201cfairy tales in one way or another.\u201d She lives in Massachusetts.",
      "From the Hardcover edition.",
      "--This text refers to an alternate",
