      "Review",
      '\u201cPlayful and intensely imaginative, Erin Morgenstern has created the circus I have always longed for . . . This is a marvelous book." \u2014Audrey Niffenegger, author of',
      "The Time Traveler\u2019s Wife",
      "\u201cA world of almost unbearable beauty. This is one of the best books I have ever read.\u201d\u2014Brunonia Barry, author of",
      "The Lace Reader",
      "Welcome to",
      "Le Cirque des R\u00eaves",
      ": Within these nocturnal black-and-white-striped tents lies an utterly unique experience, a feast for the senses. Beyond the smoke and mirrors, however, a fierce competition is under way\u2014a duel between two young magicians, Celia and Marco, who have been trained since childhood expressly for this purpose by their mercurial instructors. Unbeknownst to the players, this is a game in which only one can be left standing, and the circus is but the stage for a remarkable battle of imagination.But when Celia and Marco innocently tumble head first into love\u2014a deep, magical love that makes the lights flicker and the room grow warm whenever they so much as brush hands\u2014their masters intervene with dangerous consequences.Erin Morgenstern\u2019s singular and spell-casting debut is a mesmerizing love story for the ages.\u201cA riveting debut . . . pulls you into a world as dark as it is dazzling, fully realized but still something out of a dream. You will not want to leave it.\u201d\u2014T\u00e9a Obreht, author of",
      "The Tiger\u2019s Wife",
