      "POSTMORTEM The first Dr Kay Scarpetta novel which won five international awards for the best first crime novel of 1990. 'Terrific first novel, full of suspense, in which even the scientific bits grip.' The Times ALL THAT REMAINS A killer is stalking young lovers. Taking their lives and leaving just one tantalising clue . 'Another triumph for Patricia Cornwell's special brew of forensic and intuitive sleuthing.' Sunday Times Visit Patricia Cornwell's own website at www.patricia- cornwell.com",
      "From Publishers Weekly",
      "Cornwell, a former reporter who has worked in a medical examiner's office, sets her first mystery in Richmond, Va. Chief medical officer for the commonwealth of Virginia, Dr. Kay Scarpetta, the narrator, dwells on her efforts to identify \"Mr. Nobody,\" the strangler of young women. The doctor devotes days and nights to gathering computer data and forensic clues to the killer, although she's hampered by male officials anxious to prove themselves superior to a woman. Predictably, Scarpetta's toil pays off, but not before the strangler attacks her; a reformed male chauvinist, conveniently nearby, saves her. Although readers may be naturally disposed to admire Scarpetta and find the novel's scientific aspect interesting, they are likely to be put off by her self-aggrandizement and interminable complaints, annoying flaws in an otherwise promising debut. Copyright 1989 Reed Business Information, Inc.",
      "About the Author",
      "Patricia Cornwell's first novel, POSTMORTEM was awarded a unique five international awards. Her Scarpetta series have become international bestsellers and she is also the author of PORTRAIT OF A KILLER: Jack the Ripper - Case Closed. She divdes her time between Connecticut and South Carolina.",
      "Review",
      "* 'Imitators now abound, but - pathologically speaking - nobody does it like Cornwell' - Literary Review",
      "From Library Journal",
      'This award-winning novel based on Richmond\'s real-life "South Side Strangler" case introduced Virginia\'s chief medical examiner, Kay Scarpetta, and launched Cornwell\'s career. Narrator Lorelei King generally has a pleasant reading voice and uses good pacing to build suspense. However, this is not a successful merger of book and reader for American ears. Listeners may be confused to hear that Kay wears "cocky" (khaki), for instance, and accenting the second syllable of such words as modem and condom distract the listener from the story. Furthermore, the voices of supporting characters (such as Marino, a "stoopid" New Jersey cop, and Lucy, a fussy Southern child) are stereotypical. Fortunately, an unabridged version of Postmortem is available from several other producers, including Recorded Books (Audio Reviews, LJ 2/15/94). Not recommended.?Juleigh Muirhead Clark, Williamsburg, Va.Copyright 1996 Reed Business Information, Inc.',
      "From the Inside Flap",
      "The Bookcassette\u00ae format is a special recording technique developed as a means of condensing the full, unabridged audio text of a book to record it on fewer tapes. In order to listen to these tapes, you will need a cassette player with balance control to adjust left/right speaker output. Special adaptors to allow these tapes to be played on any cassette player are available through the publisher or some US retail electronics stores.",
      "From the Publisher",
      "7 1.5-hour cassettes",
      "See more",
