      "edition.",
      "From",
      "AudioFile",
      "Smith's first novel, CHILD 44 (2008), was long-listed for the Booker Prize. This second novel in his planned trilogy continues the chilling drama of life in the Soviet Union just after Khrushchev's purge of Stalin in 1956. Protagonist Leo Demidov is an ex-security officer during a time when it is dangerous to have been one of Stalin's minions. Now working as a homicide detective, Demidov is being threatened by the wife of a Russian Orthodox priest, whom he was responsible for imprisoning in the old days. Now the priest's wife has every intention of killing Demidov's daughter if he does not get her husband released from the gulag. Dennis Boutsikaris's Russian accents are superb. He brings even minor characters to life and portrays sex and age differences credibly. M.C. \u00a9 AudioFile 2009, Portland, Maine",
      "--This text refers to the",
      "mass_market",
      "edition.",
      "From",
      "Booklist",
      "*Starred Review* Smith\u2019s stunning debut, Child 44 (2008), was long-listed for the 2008 Man Booker Prize. Now he\u2019s back, and so is his long-suffering, soulful, courageous hero, Leo Demidov. It\u2019s 1956, and Leo, heartsick over his dutiful work as an MGB (State Security) agent, which requires him to send innocent people to the gulag, wants only to love and support his wife, Raisa, and their two adopted daughters, Zoya and Elena. But Nikita Khrushchev\u2019s speech to the twentieth Communist Party Congress, criticizing Stalin\u2019s brutality and mandating reform, frees many former prisoners and starts a wave of brutal reprisals against Soviet bureaucrats. Leo and his family are prime targets of a driven, devious, and dangerous female gang leader, whose goal in life is to make Leo suffer more than she did. Her machinations lead Leo through the freezing sewers of Moscow to the gulag and on to Budapest, just\u00a0as\u00a0Soviet tanks are leveling it.\u00a0As in Child 44, Smith\u2019s plotting is elaborate, and his pacing is relentless. His characters are wonderfully drawn, and the near-nonstop action is utterly gripping. Again, as in the earlier book,\u00a0however, the author\u2019s greatest success is in personalizing the stunning tragedy and brutality of life for many millions of Russians. The Secret Speech is a harrowing novel, but everyone who loved Child 44 will leap to read it. --Thomas Gaughan",
      "--This text refers to the",
      "mass_market",
      "edition.",
      "About the Author",
      "Tom Rob Smith graduated from Cambridge in 2001 and lives in London.",
      "--This text refers to the",
      "mass_market",
      "edition.",
      "See more",
