      "--This text refers to an out of print or unavailable edition of this title.",
      "About the Author",
      "Douglas Adams (1952-2001) was the much-loved author of the Hitchhiker's Guides, all of which have sold more than 15 million copies worldwide.",
      "--This text refers to an out of print or unavailable edition of this title.",
      "From",
      "AudioFile",
      "Martin Freeman has the likable manner, precise diction, and restrained silliness that the comedic Hitchhiker books require, as well as, of course, a British accent. In this third book, reluctant space traveler Arthur Dent and associates must stop the inhabitants of the planet Krikkit from destroying the universe because they're upset at not being alone in it. Freeman provides accents--his American accents are accurate, if exaggerated--and funny voices, and his voice is also electronically altered for special effects. At times it's over-the-top goofy, and some of the voice distortions verge on lacking clarity, but generally he's as clear as the sometimes complex whimsy demands. Any fan of the books should enjoy this presentation. W.M. \u00a9 AudioFile 2006, Portland, Maine--",
