      "1. neon 2. stop the train 3. in your atmosphere 4. daughters 5. free fallin' 6. everyday i have the blues 7. wait until tomorrow 8. who did you think i was 9. come wheni call 10. good love is on the way 11. out of my mind 12. vultures 13. bold as love disc 2 1. waiting on the world to change 2. slow dancing in a buring room 3. why georgia 4. the heart of life 5. i dont need no doctor 6. gravity 7. i dont trust myself 8. belief 9. i'm gonna find another you dvd entire concert program plus special features: slow dancing on mulholland drive 200. guitars, the collection post-show discussion who did you think i was--steve jordan & pino palladino multi-angle cam danny clinch photo gallery",
      "Amazon.com",
      "The much anticipated double CD of John Mayer in concert includes all the guitar player\u0092s hits, and the sound is unique. But the album is nothing more than a compilation of the different facets of Mayer, whose performance is divided into his three major stages. In the first part, he sings with the sole accompaniment of his acoustic guitar. Then he moves to a more jazz- and blues-inclined trio format (guitar, bass, and drums). Finally, Mayer joins his entire band with a rock sound. The truth is that the musician did not make the least effort to come up with new arrangements for his songs. If you have Mayer\u0092s previous live CDs, there\u0092s is not a single note here that you haven\u0092t heard before.",
      "--Ernesto S\u00e1nchez",
      "(",
      "People en Espa\u00f1ol",
      ")",
      "He aqu\u00ed el esperado disco doble en concierto de John Mayer, el mismo incluye todos los \u00e9xitos del guitarrista y tiene un sonido es excepcional. Pero tambi\u00e9n hay que decir que el disco nos es m\u00e1s que una compilaci\u00f3n de las diferentes facetas de Mayer que dividi\u00f3 su actuaci\u00f3n en tres etapas: la primera parte del concierto es \u00e9l acompa\u00f1ado por su guitarra ac\u00fastica, posteriormente viene una etapa con tr\u00edo (guitarra, bajo y bater\u00eda) que se inclina m\u00e1s hac\u00eda el Jazz y Blues, y finalmente podemos disfrutar de Mayer acompa\u00f1ado de toda su banda y con sonido rockero. La realidad es que el m\u00fasico no hizo ning\u00fan esfuerzo por crear nuevo arreglos para sus canciones, si usted tiene los discos anteriores del cantautor en vivo, no tiene por qu\u00e9 comprar este, no hay una sola nota que no haya escuchado antes. Este disco es una compilaci\u00f3n de \u00e9xitos en concierto.",
      "--Ernesto S\u00e1nchez",
      "(",
      "People en Espa\u00f1ol",
      ")",
