      "20-PAGE BOOKLET + CD. Includes new specially prepared liner notes by Penguin Guide to Jazz s writer BRIAN MORTON and by Paris prestigious JAZZ MAGAZINE. Tension is established within the ensemble and then gloriously discharged by Davis and Coltrane. The whole has a weightless and haunting quality, sustained by steady, unhurried tempos and a balance of sound that has rarely been equalled in the history of jazz recording. Kind of Blue is a record that almost everyone seems to own, but everyone should buy it again every few years and listen to it absolutely fresh. (PENGUIN GUIDE TO JAZZ). If there are indeed only a handful of albums that marked their own times in the way that Kind of Blue did, there are even less which, 60 years later, continue to bear the same importance. The members of this group would soon enter the firmament of jazz legends. The trumpeter was able to blend their contrasts, John Coltrane s fluid and burning breath, Bill Evans impressionist harmonies, in order to produce an album that is justly considered among the most precious in the history of recorded music. (JAZZ MAGAZINE).",
