      "On April 12, nine-time GRAMMY-winning singer-songwriter Norah Jones is releasing Begin Again, a collection of singles that gathers seven eclectic songs that Jones has recorded over the past year with collaborators including Jeff Tweedy and Thomas Bartlett. Begin Again will be released on 12\u201d vinyl, CD, and as a digital album and features the new song \u201cJust a Little Bit,\u201d which was produced by Jones and features her on vocals, piano, and organ along with Brian Blade on drums, Christopher Thomas on bass, Dave Guy on trumpet, and Leon Michels on tenor saxophone. The singles Jones began releasing last summer ran the gamut from riveting electronic experiments to starkly acoustic folk ballads to organ-and-horn drenched soul songs. With the addition of three more previously unreleased songs, Begin Again presents seven snapshots of creativity from one of the music world\u2019s most versatile and consistently intriguing artists. Tracklisting: 1. My Heart Is Full 2. Begin Again 3. It Was You 4. A Song with No Name 5. Uh Oh 6. Wintertime 7. Just A Little Bit",
